import { useState } from "react";
import React from "react";
import workExamples from "../workExamples"

function Information (props){
  var selectedTitle = 0;
    return (
        <div>
        <a href={workExamples[selectedTitle].link}>
          {props.title}
          </a>
          <br/>
          {props.position}
          <br/>
          {props.description}
        </div>
      );
}

export default Information;
